import { NextRequest, NextResponse } from 'next/server';
import { promisify } from 'util';

const file = "";

function base64ToUint8Array(base64: string) {
    const binaryString = Buffer.from(base64, 'base64').toString('binary');
    const len = binaryString.length;
    const bytes = new Uint8Array(len);
    for (let i = 0; i < len; i++) {
      bytes[i] = binaryString.charCodeAt(i);
    }
    return bytes;
  }

export async function GET(req: Request, res: Response) {
    try {
        // Декодируем Base64-строку в бинарные данные
        const fileBuffer = base64ToUint8Array(file);
    
        // Создаем новый объект ответа с бинарными данными
        const response = new NextResponse(fileBuffer);
    
        // Устанавливаем заголовки
        response.headers.set('Content-Type', 'application/pdf');
        response.headers.set('Content-Disposition', 'attachment; filename=Umatkereev.pdf');
    
        return response;
      } catch (error) {
        return new NextResponse('Ошибка при обработке файла', { status: 500 });
      }
}
